import React, { Component } from 'react';
import LoginCreate from '../pages/login/LoginCreate';
//default layout
class MainLogin extends Component {
  //Inherited Parent options.
  constructor(props) {
    super(props);
    this.state = {};
  }

  render() {
    return (
      <>
        <LoginCreate />
      </>
    );
  }
}

export default MainLogin;
